import Head from 'next/head';
import Navbar from './Navbar';

const Layout = (props) => (
    <div>
        <Head>
            <title>HelloApp</title>
            <link rel="stylesheet" href="https://bootswatch.com/4/litera/bootstrap.min.css"></link>
        </Head>

        <Navbar/>
        <div className="container">
        {props.children}
        </div>
      
    </div>
)

export default Layout;
